//Home.js -> Services_Module
import React, { Fragment } from 'react'


//Nested_Module_imports
import About from './About.js'
import Services from './Services.js'
import Contact from './Contact.js'


//import JSON_DATA
import Empdata from './emp.json'


//Import External CSS
import './css/styles.css';


//Home_Component
function Home() {

    //local_variable
    var local_title="Home Component"


    return(<Fragment>
              
            
              {/* <h1>{ global_title } </h1> */}
            
              <h1>{ local_title } </h1> 

              <p>
              Components are independent and reusable bits of code. They serve the same purpose as JavaScript functions, but work in isolation and return HTML via a render() function. Components come in two types, Class components and Function components, in this tutorial we will concentrate on Class components.
              </p>
  
                
                    <p>
                    JSX stands for JavaScript XML. JSX allows us to write HTML in React. JSX makes it easier to write and add HTML in React.
                    </p>
                

                    {
                  
                        Empdata.map( (data,index)=> 
                        { 
                            return(<ul key={index}>
                                        <li> { data.id } </li>  
                                        <li> { data.name } </li>
                                        <li> { data.email } </li>
                                        <li> { data.phno } </li>      
                                </ul>)
                        }
                        
                        )
                }
        



  

                <About />
                <Services />
                <Contact />

  
          </Fragment>)
  
  }


  export default Home
